import React from "react";
import { NavLink } from "react-router-dom";

export default function Usernavbar() {
  return (
    <div className="navbar">
      <NavLink
        exact
        to="/secret"
        className='filmix'
      >
        FILMIX
      </NavLink>
    </div>
  );
}
